import React from "react";

const Person = (props) => {
    return (
        <div style={{ border: '3px solid rgba(0, 0, 150, 0.5)', margin: '10px', width: '600px', textAlign: 'center'}}>
            <strong>Имя</strong>: {props.person.full_name} <br />
            <strong>email: </strong> {props.person.email} <br />
            <strong>телефон:</strong> {props.person.phone} <br />
        </div>
    );
};

export default Person
